export const dynamic = "force-dynamic";

const logger = getLoggerFromFilename({ filename: __filename });

/**
 * List open pull requests for a specific repository
 * Returns open PRs for the tasks list in admin dashboard
 *
 * @param request - NextRequest with query params: owner, repo
 * @returns NextResponse with open PR list
 */
export async function GET(request: NextRequest): Promise<NextResponse> {
  try {
    // Authenticate user from request
    const jwtPayload = getUserFromRequest(request);
    if (!jwtPayload) {
      return NextResponse.json(
        { error: "Authentication required" },
        { status: StatusCodes.UNAUTHORIZED },
      );
    }

    // Get full user object from storage
    const user = await findUserByEmail(jwtPayload.email);
    if (!user) {
      return NextResponse.json(
        { error: "User not found" },
        { status: StatusCodes.NOT_FOUND },
      );
    }

    // Check if user has repository access permissions
    if (!hasRepositoryAccess(user)) {
      logger.warn("User attempted open PR list without permissions", {
        userId: jwtPayload.userId,
        email: jwtPayload.email,
        userScopes: user.gitHubScopes,
      });

      return NextResponse.json(
        {
          error:
            "Repository access not authorized. Please authenticate with repository permissions.",
          requiresReauth: true,
          reAuthUrl: "/api/auth/github?repo_access=true",
        },
        { status: StatusCodes.FORBIDDEN },
      );
    }

    // Get query parameters
    const { searchParams } = new URL(request.url);
    const owner = searchParams.get("owner");
    const repo = searchParams.get("repo");

    if (!owner || !repo) {
      return NextResponse.json(
        { error: "Repository owner and name are required" },
        { status: StatusCodes.BAD_REQUEST },
      );
    }

    // Validate repository name format
    const repoNameRegex = /^[a-zA-Z0-9._-]+$/;
    if (!repoNameRegex.test(owner) || !repoNameRegex.test(repo)) {
      return NextResponse.json(
        { error: "Invalid repository owner or name format" },
        { status: StatusCodes.BAD_REQUEST },
      );
    }

    // Fetch open pull requests from GitHub API
    const response = await fetchGitHubAPI<GitHubPullRequest[]>(
      user,
      `/repos/${owner}/${repo}/pulls?state=open&per_page=100`,
    );

    if (!response.success) {
      return NextResponse.json(
        {
          error: response.error || "Failed to fetch open pull requests",
          requiresReauth: response.requiresReauth,
          reAuthUrl: response.reAuthUrl,
        },
        {
          status: response.requiresReauth
            ? StatusCodes.UNAUTHORIZED
            : StatusCodes.INTERNAL_SERVER_ERROR,
        },
      );
    }

    const pullRequests = response.data || [];

    logger.info("Open PR list fetched successfully", {
      userId: jwtPayload.userId,
      email: jwtPayload.email,
      owner,
      repo,
      prCount: pullRequests.length,
    });

    return NextResponse.json({
      success: true,
      data: {
        pullRequests,
        total: pullRequests.length,
        repository: {
          owner,
          name: repo,
        },
      },
      userPermissions: {
        hasRepoAccess: true,
        scopes: user.gitHubScopes || [],
      },
    });
  } catch (error) {
    const errorMessage = error instanceof Error ? error.message : String(error);

    logger.error("Open PR list fetch failed", {
      error: errorMessage,
      stack: error instanceof Error ? error.stack : undefined,
      url: request.url,
    });

    return NextResponse.json(
      {
        error: "Failed to fetch open pull requests. Please try again.",
        details: getNodeEnv() === "development" ? errorMessage : undefined,
      },
      { status: StatusCodes.INTERNAL_SERVER_ERROR },
    );
  }
}

