import { StatusCodes } from "http-status-codes";

import { getLoggerFromFilename } from "@/lib/logging";
import type { User } from "@/types/user";

const logger = getLoggerFromFilename({ filename: __filename });

/**
 * GitHub API error response
 */
export interface GitHubAPIError {
  message: string;
  documentation_url?: string;
  status?: number;
}

/**
 * GitHub API client response
 */
export interface GitHubAPIResponse<T> {
  success: boolean;
  data?: T;
  error?: string;
  requiresReauth?: boolean;
  reAuthUrl?: string;
}

/**
 * Creates headers for authenticated GitHub API requests
 * @param user - User with GitHub authentication
 * @returns Headers object for fetch requests
 */
export function createGitHubHeaders(user: User): HeadersInit {
  if (!user.gitHubAccessToken) {
    throw new Error("User does not have a GitHub access token");
  }

  return {
    Authorization: `Bearer ${user.gitHubAccessToken}`,
    Accept: "application/vnd.github.v3+json",
    "User-Agent": "enric-web-app",
    "Content-Type": "application/json",
  };
}

/**
 * Checks if user has a valid GitHub access token
 * @param user - User to check
 * @returns True if user has valid token, false otherwise
 */
export function hasValidGitHubToken(user: User): boolean {
  if (!user.gitHubAccessToken) {
    return false;
  }

  // Check if token is expired
  if (user.gitHubTokenExpiry) {
    const now = new Date();
    const expiry = new Date(user.gitHubTokenExpiry);
    if (now >= expiry) {
      return false;
    }
  }

  return true;
}

/**
 * Makes an authenticated request to the GitHub API
 * @param user - User with GitHub authentication
 * @param endpoint - GitHub API endpoint (e.g., "/user/repos")
 * @param options - Additional fetch options
 * @returns Promise resolving to API response
 */
export async function fetchGitHubAPI<T>(
  user: User,
  endpoint: string,
  options: RequestInit = {},
): Promise<GitHubAPIResponse<T>> {
  try {
    // Validate token
    if (!hasValidGitHubToken(user)) {
      logger.warn("User GitHub token is invalid or expired", {
        userId: user.id,
        email: user.email,
        hasToken: !!user.gitHubAccessToken,
        tokenExpiry: user.gitHubTokenExpiry,
      });

      return {
        success: false,
        error: "GitHub access token is invalid or expired",
        requiresReauth: true,
        reAuthUrl: "/api/auth/github?repo_access=true",
      };
    }

    // Construct full URL
    const url = endpoint.startsWith("https://")
      ? endpoint
      : `https://api.github.com${endpoint}`;

    // Make request
    const response = await fetch(url, {
      ...options,
      headers: {
        ...createGitHubHeaders(user),
        ...options.headers,
      },
    });

    // Handle rate limiting
    if (response.status === StatusCodes.FORBIDDEN) {
      const rateLimitRemaining = response.headers.get("x-ratelimit-remaining");
      if (rateLimitRemaining === "0") {
        const rateLimitReset = response.headers.get("x-ratelimit-reset");
        const resetDate = rateLimitReset
          ? new Date(parseInt(rateLimitReset) * 1000)
          : new Date();

        logger.warn("GitHub API rate limit exceeded", {
          userId: user.id,
          endpoint,
          resetDate,
        });

        return {
          success: false,
          error: `GitHub API rate limit exceeded. Resets at ${resetDate.toISOString()}`,
        };
      }
    }

    // Handle unauthorized (token expired or invalid)
    if (response.status === StatusCodes.UNAUTHORIZED) {
      logger.warn("GitHub API returned unauthorized", {
        userId: user.id,
        endpoint,
      });

      return {
        success: false,
        error: "GitHub authentication failed. Please re-authenticate.",
        requiresReauth: true,
        reAuthUrl: "/api/auth/github?repo_access=true",
      };
    }

    // Handle other error statuses
    if (!response.ok) {
      const errorData = (await response
        .json()
        .catch(() => ({}))) as GitHubAPIError;
      const errorMessage =
        errorData.message || `GitHub API error: ${response.status}`;

      logger.error("GitHub API request failed", {
        userId: user.id,
        endpoint,
        status: response.status,
        error: errorMessage,
      });

      return {
        success: false,
        error: errorMessage,
      };
    }

    // Parse successful response
    const data = (await response.json()) as T;

    logger.info("GitHub API request successful", {
      userId: user.id,
      endpoint,
    });

    return {
      success: true,
      data,
    };
  } catch (error) {
    const errorMessage = error instanceof Error ? error.message : String(error);

    logger.error("GitHub API request exception", {
      userId: user.id,
      endpoint,
      error: errorMessage,
      stack: error instanceof Error ? error.stack : undefined,
    });

    return {
      success: false,
      error: `Failed to communicate with GitHub API: ${errorMessage}`,
    };
  }
}

